To depend on a library located in a git repository, the minimum information you need to specify is the location of the repository with the git key: [dependencies]
rand = { git = "https://github.com/rust-lang-nursery/rand" } Cargo will fetch the git repository at this location then look for a Cargo.toml for the requested crate anywhere inside the git repository (not necessarily at the root - for example, specifying a member crate name of a workspace and setting git to the repository containing the workspace). Since we haven’t specified any other information, Cargo assumes that we intend to use the latest commit on the master branch to build our package. You can combine the git key with the rev , tag , or branch keys to specify something else. Here's an example of specifying that you want to use the latest commit on a branch named next : [dependencies]
rand = { git = "https://github.com/rust-lang-nursery/rand", branch = "next" }

