Some Cargo packages need to have code generated just before they are compiled for various reasons. Here we’ll walk through a simple example which generates a library call as part of the build script. First, let’s take a look at the directory structure of this package: .
├── Cargo.toml
├── build.rs
└── src └── main.rs 1 directory, 3 files Here we can see that we have a build.rs build script and our binary in main.rs . Next, let’s take a look at the manifest: # Cargo.toml [package]
name = "hello-from-generated-code"
version = "0.1.0"
authors = ["you@example.com"]
build = "build.rs" Here we can see we’ve got a build script specified which we’ll use to generate some code. Let’s see what’s inside the build script: // build.rs use std::env;
use std::fs::File;
use std::io::Write;
use std::path::Path; fn main() { let out_dir = env::var("OUT_DIR").unwrap(); let dest_path = Path::new(&out_dir).join("hello.rs"); let mut f = File::create(&dest_path).unwrap(); f.write_all(b" pub fn message() -> &'static str { \"Hello, World!\" } ").unwrap();
} There’s a couple of points of note here: The script uses the OUT_DIR environment variable to discover where the output files should be located. It can use the process’ current working directory to find where the input files should be located, but in this case we don’t have any input files. In general, build scripts should not modify any files outside of OUT_DIR . It may seem fine on the first blush, but it does cause problems when you use such crate as a dependency, because there's an implicit invariant that sources in .cargo/registry should be immutable. cargo won't allow such scripts when packaging. This script is relatively simple as it just writes out a small generated file. One could imagine that other more fanciful operations could take place such as generating a Rust module from a C header file or another language definition, for example. Next, let’s peek at the library itself: // src/main.rs include!(concat!(env!("OUT_DIR"), "/hello.rs")); fn main() { println!("{}", message());
} This is where the real magic happens. The library is using the rustc-defined include! macro in combination with the concat! and env! macros to include the generated file ( hello.rs ) into the crate’s compilation. Using the structure shown here, crates can include any number of generated files from the build script itself.

